import React from 'react';
import { Card, Typography, List, ListItem, ListItemIcon, ListItemText, Divider, Box, Chip } from '@mui/material';
import {
  MedicalServices,
  Warning,
  CheckCircle,
  Info,
  LocalHospital,
  MonitorHeart,
  Psychology,
  FitnessCenter,
  Restaurant,
  Spa
} from '@mui/icons-material';

const MedicalHistoryAnalysis = ({ analysis }) => {
  if (!analysis) return null;

  // Extract the analysis text from the response
  const analysisText = analysis.analysis || '';

  // Parse different sections from the analysis text
  const sections = [
    {
      title: 'Medical History Summary',
      icon: <MedicalServices />,
      content: analysis.patient_info?.medical_history || 'No medical history provided'
    },
    {
      title: 'Differential Diagnosis',
      icon: <Warning />,
      content: extractSection(analysisText, 'Differential Diagnosis') || 'Analysis pending'
    },
    {
      title: 'Risk Assessment',
      icon: <LocalHospital />,
      content: extractSection(analysisText, 'Risk Assessment') || 'Analysis pending'
    },
    {
      title: 'Recommended Tests',
      icon: <MonitorHeart />,
      content: extractSection(analysisText, 'Recommended Diagnostic Workup') || 'Analysis pending'
    },
    {
      title: 'Treatment Considerations',
      icon: <CheckCircle />,
      content: extractSection(analysisText, 'Treatment Considerations') || 'Analysis pending'
    },
    {
      title: 'Follow-up Plan',
      icon: <Info />,
      content: extractSection(analysisText, 'Follow-up Recommendations') || 'Analysis pending'
    }
  ];

  const lifestyleSections = [
    {
      title: 'Diet Recommendations',
      icon: <Restaurant />,
      content: extractSection(analysisText, 'Diet and nutrition') || 'Balanced diet recommendations pending'
    },
    {
      title: 'Exercise Guidelines',
      icon: <FitnessCenter />,
      content: extractSection(analysisText, 'Exercise guidelines') || 'Exercise recommendations pending'
    },
    {
      title: 'Stress Management',
      icon: <Spa />,
      content: extractSection(analysisText, 'Stress management') || 'Stress management recommendations pending'
    }
  ];

  // Helper function to extract sections from the analysis text
  function extractSection(text, sectionTitle) {
    if (!text) return null;
    const sections = text.split(/\d+\.\s+/); // Split by numbered sections
    const section = sections.find(s => s.includes(sectionTitle));
    if (section) {
      const content = section.split(sectionTitle + ':')[1]?.trim();
      return content || section.trim();
    }
    return null;
  }

  return (
    <Box sx={{ mt: 4 }}>
      <Typography variant="h4" gutterBottom sx={{ color: '#2c3e50', fontWeight: 'bold' }}>
        Medical Analysis Report
      </Typography>

      <Card sx={{ p: 3, mb: 3, backgroundColor: '#f8f9fa', boxShadow: 3 }}>
        <Typography variant="h6" gutterBottom sx={{ color: '#34495e', display: 'flex', alignItems: 'center', gap: 1 }}>
          <MedicalServices sx={{ color: '#3498db' }} />
          Patient Overview
        </Typography>
        <Typography variant="body1" sx={{ color: '#2c3e50', mt: 2 }}>
          Age: {analysis.patient_info?.age || 'Not provided'}<br />
          Gender: {analysis.patient_info?.gender || 'Not provided'}<br />
          Symptoms: {analysis.symptoms?.join(', ') || 'None provided'}
        </Typography>
      </Card>

      <Box sx={{ display: 'grid', gridTemplateColumns: { xs: '1fr', md: '1fr 1fr' }, gap: 3 }}>
        <Card sx={{ p: 3, backgroundColor: '#f8f9fa', boxShadow: 3 }}>
          <Typography variant="h6" gutterBottom sx={{ color: '#34495e', mb: 2 }}>
            Clinical Assessment
          </Typography>
          <List>
            {sections.map((section, index) => (
              <React.Fragment key={index}>
                <ListItem>
                  <ListItemIcon sx={{ color: '#3498db' }}>
                    {section.icon}
                  </ListItemIcon>
                  <ListItemText
                    primary={
                      <Typography variant="subtitle1" sx={{ fontWeight: 'bold', color: '#2c3e50' }}>
                        {section.title}
                      </Typography>
                    }
                    secondary={
                      <Typography variant="body2" sx={{ color: '#34495e', mt: 1 }}>
                        {section.content}
                      </Typography>
                    }
                  />
                </ListItem>
                {index < sections.length - 1 && <Divider />}
              </React.Fragment>
            ))}
          </List>
        </Card>

        <Card sx={{ p: 3, backgroundColor: '#f8f9fa', boxShadow: 3 }}>
          <Typography variant="h6" gutterBottom sx={{ color: '#34495e', mb: 2 }}>
            Lifestyle Recommendations
          </Typography>
          <List>
            {lifestyleSections.map((section, index) => (
              <React.Fragment key={index}>
                <ListItem>
                  <ListItemIcon sx={{ color: '#2ecc71' }}>
                    {section.icon}
                  </ListItemIcon>
                  <ListItemText
                    primary={
                      <Typography variant="subtitle1" sx={{ fontWeight: 'bold', color: '#2c3e50' }}>
                        {section.title}
                      </Typography>
                    }
                    secondary={
                      <Typography variant="body2" sx={{ color: '#34495e', mt: 1 }}>
                        {section.content}
                      </Typography>
                    }
                  />
                </ListItem>
                {index < lifestyleSections.length - 1 && <Divider />}
              </React.Fragment>
            ))}
          </List>
        </Card>
      </Box>

      <Card sx={{ p: 3, mt: 3, backgroundColor: '#f8f9fa', boxShadow: 3 }}>
        <Typography variant="h6" gutterBottom sx={{ color: '#34495e', display: 'flex', alignItems: 'center', gap: 1 }}>
          <Psychology sx={{ color: '#e74c3c' }} />
          Important Notes
        </Typography>
        <List>
          <ListItem>
            <ListItemText
              primary={
                <Typography variant="body1" sx={{ color: '#2c3e50' }}>
                  • This is an AI-generated preliminary analysis and should not replace professional medical evaluation
                </Typography>
              }
            />
          </ListItem>
          <ListItem>
            <ListItemText
              primary={
                <Typography variant="body1" sx={{ color: '#2c3e50' }}>
                  • Seek immediate medical attention if symptoms worsen or new symptoms develop
                </Typography>
              }
            />
          </ListItem>
          <ListItem>
            <ListItemText
              primary={
                <Typography variant="body1" sx={{ color: '#2c3e50' }}>
                  • Regular follow-up with healthcare providers is essential
                </Typography>
              }
            />
          </ListItem>
        </List>
      </Card>
    </Box>
  );
};

export default MedicalHistoryAnalysis;
